import swal from "sweetalert"
import axios from "axios";
import { useState,useEffect }  from "react";
import { Link,useNavigate} from "react-router-dom";
const URI = "http://localhost:8080/cuenta/"

let headers = {
    "usuario" : sessionStorage.getItem("usuario"),
    "clave"   : sessionStorage.getItem("clave")
  };
const Cuenta = () => {
    const navigate = useNavigate();
    const [cuentas, setCuentas] = useState([])
    useEffect(() =>{
        getCuentas()
    })

    const getCuentas = async () =>{
        try {
            
            const res = await axios({
                method : "GET",
                url : URI + "consulta_cuenta?idc="+sessionStorage.getItem("usuario"),
                headers: headers 
               
            });
            alert(URI + "consulta_cuenta?idc="+sessionStorage.getItem("usuario"))
            setCuentas(res.data)
            
            //console.log(clientes)
        }
        catch (error) {
            
        }
    }


    return(
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <table className='table'>
                        <thead className='table-primary'>
                            <tr>
                                <th>Cuenta</th>
                                <th>Fecha Apertura</th>
                                <th>Saldo</th>
                            </tr>
                        </thead>
                        <tbody>
                            { cuentas.map ( (cuenta) => (
                                <tr key={ cuenta.id_cuenta}>
                                    <td> { cuenta.fecha_apertura } </td>
                                    <td> { cuenta.saldo_cuenta } </td>
                                    <td>
                                        <Link to={`/deposito/${cuenta.id_cuenta}`} className='btn btn-info'><i className="fas fa-edit"></i></Link>
                                        <Link to={`/retiro/${cuenta.id_cuenta}`} className='btn btn-info'><i className="fas fa-edit"></i></Link>
                                        <Link to={`/movimiento/${cuenta.id_cuenta}`} className='btn btn-info'><i className="fas fa-edit"></i></Link>
                                    </td>
                                </tr>
                            )) }
                        </tbody>
                    </table>
                </div>    
            </div>
        </div>
    );
};

export default Cuenta;
